import React, { useState } from 'react'

export const Form = () => {
  const [name,setName]= useState({
    fname:''
  });
  const changeInput=(event)=>{setName(event.target.value)
  };
  return (
    <div style={{textAlign:'center',background:'purple',height:'100vh',width:'100vw'}}>
      <form onSubmit={(e)=>{setName(name); e.preventDefault();alert('submitted')}} >

        <h1>Hello {name.fname}</h1><br />
        <input 
        onChange={changeInput}
        value={name.fname}
         />
        <button type='submit'>Click me</button>
        </form>
    </div>
  )
}
